import React, { useState, useCallback } from 'react';
import './PhotoAnalysis.css';

function PhotoAnalysis() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [previewUrl, setPreviewUrl] = useState(null);
  const [analysisResult, setAnalysisResult] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleFileChange = useCallback((event) => {
    const file = event.target.files[0];
    if (file) {
      setSelectedFile(file);
      setPreviewUrl(URL.createObjectURL(file));
      setAnalysisResult(null); // Reset previous analysis
    } else {
      setSelectedFile(null);
      setPreviewUrl(null);
    }
  }, []);

  const handleAnalysis = useCallback(() => {
    if (!selectedFile) return;

    setIsLoading(true);
    setAnalysisResult(null);

    // Simulate AI analysis (enhanced mock data)
    setTimeout(() => {
      const mockAnalysis = {
        fileName: selectedFile.name,
        sceneDescription: "가을 공원에서 두 친구가 밝게 웃으며 셀카를 찍고 있는 따뜻한 장면입니다.",
        detailedObjects: [
          { name: '사람', confidence: 0.95 },
          { name: '나무', confidence: 0.88 },
          { name: '스웨터', confidence: 0.75 },
          { name: '단풍잎', confidence: 0.60 },
          { name: '스마트폰', confidence: 0.92 },
        ],
        emotions: ['기쁨', '친밀감', '만족'],
        context: '화창한 가을날 공원에서의 즐거운 한때',
        ocrText: null, // Example: "Happy Birthday!" if text was present
        dominantColors: ['#D4A373', '#A98768', '#EFEFEF', '#BF573F', '#4A4A4A'],
        generatedQuestions: [
          "이 사진을 찍을 때 어떤 재미있는 대화를 나누셨나요?",
          "사진 속 친구와 가장 기억에 남는 다른 추억은 무엇인가요?",
          "이 공원에 다시 간다면 무엇을 하고 싶으신가요?",
        ],
        creativePrompts: [
          '이 사진의 분위기에 어울리는 짧은 시나 이야기를 작성해보세요.',
          '사진 속 장소와 비슷한 느낌의 다른 장소를 찾아 사진으로 남겨보세요.',
          '이 사진을 보고 떠오르는 노래가 있다면 공유해주세요.',
          '사진 속 인물에게 AI가 되어 칭찬의 메시지를 보내보는 건 어떨까요?'
        ]
      };
      setAnalysisResult(mockAnalysis);
      setIsLoading(false);
    }, 2500); // Slightly increased delay for more "processing" feel
  }, [selectedFile]);

  return (
    <section className="photo-analysis-section">
      <h2>📸 사진 분석 및 상호작용 (AI 시뮬레이션)</h2>
      <p>사진을 업로드하면 AI가 사진의 요소들을 분석하고, 이를 바탕으로 다양한 활동을 제안합니다. (현재는 시뮬레이션된 결과입니다)</p>

      <div className="upload-area">
        <input type="file" accept="image/*" onChange={handleFileChange} />
        {previewUrl && (
          <div className="image-preview">
            <img src={previewUrl} alt="업로드된 사진 미리보기" />
          </div>
        )}
      </div>

      <button 
        className="analysis-button" 
        onClick={handleAnalysis} 
        disabled={!selectedFile || isLoading}
      >
        {isLoading ? 'AI 분석 중...' : 'AI 분석 시작'}
      </button>

      {isLoading && <p className="loading-message">AI가 사진을 심층 분석하고 있습니다. 잠시만 기다려 주세요...</p>}

      {analysisResult && (
        <div className="analysis-result">
          <h3>AI 분석 결과 (시뮬레이션)</h3>
          <p><strong>파일명:</strong> {analysisResult.fileName}</p>
          <p><strong>AI의 사진 설명:</strong> {analysisResult.sceneDescription}</p>

          <h4>인식된 주요 객체:</h4>
          <ul>
            {analysisResult.detailedObjects.map((obj, index) => (
              <li key={index}>{obj.name} (정확도: {Math.round(obj.confidence * 100)}%)</li>
            ))}
          </ul>

          <p><strong>주요 감정:</strong> {analysisResult.emotions.join(', ')}</p>
          <p><strong>사진의 맥락:</strong> {analysisResult.context}</p>
          {analysisResult.ocrText && <p><strong>사진 속 텍스트:</strong> {analysisResult.ocrText}</p>}

          <h4>추출된 주요 색상:</h4>
          <div style={{ display: 'flex', marginTop: '10px', marginBottom: '15px' }}>
            {analysisResult.dominantColors.map((color, index) => (
              <div 
                key={index} 
                style={{ 
                  backgroundColor: color, 
                  width: '30px', 
                  height: '30px', 
                  marginRight: '5px',
                  borderRadius: '4px',
                  border: '1px solid #ccc'
                }}
                title={color}
              ></div>
            ))}
          </div>

          <h4>AI가 묻고 싶어요:</h4>
          <ul>
            {analysisResult.generatedQuestions.map((question, index) => (
              <li key={index}>{question}</li>
            ))}
          </ul>

          <h4>AI 추천! 이런 활동은 어때요?:</h4>
          <ul>
            {analysisResult.creativePrompts.map((prompt, index) => (
              <li key={index}>{prompt}</li>
            ))}
          </ul>
        </div>
      )}
    </section>
  );
}

export default PhotoAnalysis;
